  false,\n\t\"url\": null,\n\t\"notes\": \"The Cameron Prairie National Wildlife Refuge
  Habitat Management Plan provides a long-term vision and specific guidance on managing
  habitats for the resources of concern at Cameron Prairie, to facilitate continuity
  in management programs. Refuge background, resources of concern, and habitat management
  goals and objectives are discussed. Management strategies and prescriptions then
  identify how and the specific means by which management and monitoring strategies
  will be implemented. Appendices follow.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
